"use strict";
var LEADING_ARRAY = /\[/g;
var TRAILING_ARRAY = /^\[|\]/g;
var get = function (obj, path, def) {
    try {
        return path
            .replace(TRAILING_ARRAY, '')
            .replace(LEADING_ARRAY, '.')
            .split('.')
            .reduce(function (a, b) { return a[b]; }, obj) || def;
    }
    catch (e) {
        return def;
    }
};
module.exports = { get: get };
